import React from "react";
import { v4 as uuidv4 } from "uuid";
import Card from "react-bootstrap/Card";

const Favourites = (props) => {
  console.log("props for Favourites: " + props.favList);

  let favMovieList = props.favList.map((url, index) => {
    return (
      <div key={uuidv4()} id={index} className="fav">
        <img src={url} alt="" width="200px" />
        <button onClick={props.removeFav} className="btn btn-danger">
          X
        </button>
      </div>
    );
  });

  return (
    <div className="favContainer">
      <h2>Favourites:</h2>
      {favMovieList}
    </div>
  );
};
export default Favourites;
